import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';

const PieChart: React.FC = () => {
  const options: Highcharts.Options = {
    chart: {
      type: 'pie'
    },
    // title: {
    //   text: 'User Activity Breakdown'
    // },
    // tooltip: {
    //   pointFormat: '{series.name}: <b>{point.percentage:.1f}%</b>'
    // },
    accessibility: {
      point: {
        valueSuffix: '%'
      }
    },
    plotOptions: {
      pie: {
        // allowPointSelect: true,
        borderRadius:0,
        // cursor: 'pointer',
        dataLabels: {
          enabled: true,
          format: '{point.percentage:.1f}',
          distance:-13,
          style:{
            fontSize:'10px',
            fontWeight:'400',
            color:'#ffffff',
            textOutline:'none'
          }
        }
      }
    },
    series: [
      {
        name: 'Activities',
        type: 'pie',
        innerSize:'70%',
        size:'100%',
        // colorByPoint: true,
        data: [
          { name: 'Messages', y: 45 },
          { name: 'eBay', y: 25 },
          { name: 'Amazon', y: 15 },
          { name: ' Walmart', y: 20 },
          { name: 'Facebook', y: 10 }
        ]
      }
    ]
  };

  return (
      <HighchartsReact style={{backgroundColor:'red'}} highcharts={Highcharts} options={options} />
  );
};

export default PieChart;
